from sympy import factorint
def ok(n):
    f = factorint(n)
    return sum(f.values()) > 1 and sorted(str(n)) == sorted("".join(str(p)*f[p] for p in f))
print([k for k in range(700000) if ok(k)]) # _Michael S. Branicky_, Apr 20 2025

